--
-- Create procedure `Proc_Getfixed_assetPaging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Getfixed_assetPaging (IN v_keyword varchar(255) -- từ khoá tìm kiếm
, IN v_departmentId char(36) -- lọc theo phòng ban
, IN v_fixedAssetCategoryId char(36) -- lọc theo loại tài sản
, IN v_limit int -- số bản ghi xuất hiện
, IN v_offset int -- vị trí bản ghi đầu tiên
)
COMMENT '
  -- Author: Duongpv
  -- Created date: 11/01/2023
  -- Description: Lấy danh sách tài sản theo phân trang
  -- Code chạy thử:CALL misa.qlts.PROC_fixed_asset_GetAssetPaging("", 10, 0);'
BEGIN
  DECLARE keyword varchar(255) DEFAULT '';
  DECLARE searchDepartmentId varchar(255) DEFAULT '';
  DECLARE searchFixedAssetCategoryId varchar(255) DEFAULT '';

  -- Nếu keyword null thì gán bằng rỗng
  IF v_keyword IS NULL THEN
    SET v_keyword = '';
  END IF;

  IF v_departmentId IS NULL THEN
    SET v_departmentId = '';
  END IF;

  IF v_fixedAssetCategoryId IS NULL THEN
    SET v_fixedAssetCategoryId = '';
  END IF;


  SET keyword = CONCAT('%', v_keyword, '%');
  SET searchDepartmentId = CONCAT('%', v_departmentId, '%');
  SET searchFixedAssetCategoryId = CONCAT('%', v_fixedAssetCategoryId, '%');

  SELECT
    fac.FixedAssetCategoryId,
    fac.FixedAssetCategoryCode,
    fac.FixedAssetCategoryName,
    fac.DepreciationRate,
    fac.LifeTime,
    fac.CreatedBy,
    fac.CreatedDate,
    fac.ModifiedBy,
    fac.ModifiedDate,
    fa.FixedAssetId,
    fa.FixedAssetCode,
    fa.FixedAssetName,
    fa.DepartmentId,
    fa.DepartmentCode,
    d.DepartmentId,
    d.DepartmentCode,
    d.DepartmentName,
    fa.PurchaseDate,
    fa.Cost,
    fa.Quantity,
    fa.DepreciationRate,
    fa.TrackedYear,
    fa.LifeTime,
    fa.ProductionYear,
    fa.CreatedBy,
    fa.CreatedDate,
    fa.ModifiedBy,
    fa.ModifiedDate
  FROM fixed_asset fa
    LEFT JOIN department d
      ON fa.DepartmentId = d.DepartmentId
    LEFT JOIN fixed_asset_category fac
      ON fa.FixedAssetCategoryId = fac.FixedAssetCategoryId
  WHERE fa.FixedAssetName COLLATE utf8mb4_general_ci LIKE keyword
  AND fa.DepartmentId COLLATE utf8mb4_general_ci LIKE searchDepartmentId
  AND fa.FixedAssetCategoryId COLLATE utf8mb4_general_ci LIKE searchFixedAssetCategoryId
  ORDER BY fa.CreatedDate DESC
  LIMIT v_limit
  OFFSET v_offset;

  SELECT
    COUNT(fa.FixedAssetId) AS ToltalCount
  FROM fixed_asset fa
    LEFT JOIN department d
      ON fa.DepartmentId = d.DepartmentId
    LEFT JOIN fixed_asset_category fac
      ON fa.FixedAssetCategoryId = fac.FixedAssetCategoryId
  WHERE fa.FixedAssetName COLLATE utf8mb4_general_ci LIKE keyword
  AND fa.DepartmentId COLLATE utf8mb4_general_ci LIKE searchDepartmentId
  AND fa.FixedAssetCategoryId COLLATE utf8mb4_general_ci LIKE searchFixedAssetCategoryId;
END
$$

